// HasLeaveAllowances applies the HasEdge predicate on the "leave_allowances" edge.
func HasLeaveAllowances() predicate.AbsenceType {
	return predicate.AbsenceType(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, LeaveAllowancesTable, LeaveAllowancesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasLeaveAllowancesWith applies the HasEdge predicate on the "leave_allowances" edge with a given conditions (other predicates).
func HasLeaveAllowancesWith(preds ...predicate.LeaveAllowance) predicate.AbsenceType {
	return predicate.AbsenceType(func(s *sql.Selector) {
		step := newLeaveAllowancesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

